import React from "react";
import { useNavigate } from "react-router-dom";

const AuthPage = () => {
  const navigate = useNavigate();

  return (
    <div className="flex flex-col items-center justify-center h-screen bg-gray-100">
      <h1 className="text-3xl font-bold mb-6">Welcome to Study Tracker</h1>
      <div className="space-x-4">
        <button onClick={() => navigate("/register")} className="px-6 py-3 bg-green-500 text-white rounded">Register</button>
        <button onClick={() => navigate("/login")} className="px-6 py-3 bg-blue-500 text-white rounded">Login</button>
      </div>
    </div>
  );
};

export default AuthPage;
